import React from "react";
import Card from "../Card";

function App() {
    const characters = [
        {
            image: "mi-proyecto/public/imgs/characters/ahsoka.jpg",
            name: "ahsoka",
            description: "Una ex-Jedi y aprendiz de Anakin Skywalker",
            link: "#"
        },
        {
            image: "./imgs/characters/anakin.jpg",
            name: "anakin",
            description: "DEl Caballero Jedi que cayó al lado oscuro y se convirtió en Darth Vader",
            link: "#"
        },
        {
            image: "./imgs/characters/batman.jpg",
            name: "batman",
            description: "El Caballero Oscuro de Gotham",
            link: "#"
        },
        {
            image: "./imgs/characters/capAmerica.jpg",
            name: "capAmerica",
            description: "El super soldado de la Segunda Guerra Mundial",
            link: "#"
        },
        {
            image: "./imgs/characters/cell.jpg",
            name: "cell",
            description: "Descripción del personaje 1Un villano bio-android de Dragon Ball Z"
        },
        {
            image: "./imgs/characters/hulkSmall.jpg",
            name: "hulkSmall",
            description: "El científico Bruce Banner",
            link: "#"
        }

    ];

    return (
        <div className="character-grid">
            {characters.map((character) => (
                <Card

                    image={character.image}
                    name={character.name}
                    description={character.description}
                    link={character.link}

                />
            ))}
        </div>
    );
}

export default App;
